export default function Card({}){
    return (
        <div>
                <div>
                    <img src={propsimg} />
                </div>
                <div className="card-price">{propsprice}</div>
                <span className="card-city">{propsplace}</span>
                <p>
                    {propsdesc}
                </p>
                <button>
                    Not Interested
                   
                </button>
        </div>
    );
}
